svg.script:

var params = { };
location.href.split( '?' )[1].split( '&' ).forEach(
    function( i )
    {
        params[ i.split( '=' )[0] ] = i.split( '=' )[1];
    }
);

if( params.color )
{
	var path = document.getElementsByTagName( "path" );
    path[0].setAttribute( "fill", params.color );
    path[1].setAttribute( "fill", params.color );
}
